// Modules //
import React from 'react';
import axios from 'axios';
import Fade from 'react-reveal/Fade';

// Style //
import { Container, Col, Row, Card } from 'react-bootstrap';
import './Caractere.scss';

class Main extends React.Component {

  render() {
    return (
      <div className="div_cara">
        <Container>
            <Row>
            <Fade cascade>
            <Col>
            <h2 className="h2_cara">Caractere</h2>
                <Card className="border-0">
                    <Card.Body className="">
                        <Card.Title>Anglais</Card.Title>
                        <Card.Subtitle>Samsung Campus, Saint-Ouen</Card.Subtitle>
                        <Card.Title>Japonais</Card.Title>
                        <Card.Subtitle>Samsung Campus, Saint-Ouen</Card.Subtitle>
                    </Card.Body>
                </Card>
                </Col>
                <Col>
                <h2 className="h2_centre">Centre d'intérêts</h2>
                <Card className="border-0">
                    <Card.Body className="">
                        <Card.Title>Art et Dessin</Card.Title>
                        <Card.Subtitle>En tant que passe-temps</Card.Subtitle>
                        <Card.Title>Linguistique</Card.Title>
                        <Card.Subtitle>Cours suivis à l'université.</Card.Subtitle>
                    </Card.Body>
                </Card>
                </Col>
            </Fade>
          </Row>
        </Container>
      </div>
    );
  }
}

export default Main;
